import React from 'react';

import {Link} from 'react-router-dom';
import './navbar.css'
const Navbar = () => {

 
  return (
    <div className='navbare'>
    <div className='containnet'>
        <div className='logoo'><img height="50" width="140" src="https://influencermarketinghub.com/wp-content/uploads/2018/03/influencer_logo.png" alt="logo"/></div>
       <ul>
       <li><Link to='/'>Home</Link></li> 
       <li><Link to='/'>A propos</Link></li> 
         <li><Link to='/team'> Notre Equipe </Link></li> <Link to='/tarif'>Tarifs</Link>
        
        <li></li><Link to='/contact'> Contacter </Link>

        
       <li></li> 

        
        </ul> 
    </div>
    
  
</div>
    
  )
}

export default Navbar
